    private void SearchFlight()
    {
        AirportDatas.Clear();
        foreach (var data in datas)
        {
            if ((data.StartLocation.ToLower().Equals(searchTerm.ToLower()))
                || (data.EndLocation.ToLower().Equals(searchTerm.ToLower())))
